import React from "react";
import { logout, isAuthenticated } from "../../services/auth";

import "./styles.css";

const Header = () => (
    <header >
        <div className="main-header">Light My Mind</div>
    <div className="actions"><button onClick={this.logout} hidden={isAuthenticated}></button>Sair</div>
    </header>
);

logout = () => {
    logout();
}

export default Header;
